# A generator of the Motzkin-paths with at least one up-step.
C = str.count
def aGen(n: int): # -> Generator[str, Any, list[str]]
    a = [""]
    for w in a:
        if len(w) == n + 1:
            if (C(w, "U") > 0 and C(w, "U") == C(w, "D")): yield w
        else:
            for j in "UDF":
                u = w + j
                if C(u, "U") >= C(u, "D"): a += [u]
    return a
for n in range(1, 6):
    SAP = [w for w in aGen(n)]
    print(len(SAP), ":", SAP)  # _Peter Luschny_, Dec 03 2024

